function App() {
    return (
        <> 
        <div>
            <img src="" alt="" />
        </div>
            <div className="container">
                <Logo name = "AFSSY" />
                <Dropdown />
                <Nav/>
            </div>
            <Form />   
        </>
    )
}
export default App;


